import { NavigationContainer } from "@react-navigation/native";
import { createNativeStackNavigator } from "@react-navigation/native-stack";
import React from "react";
import { Platform, StatusBar, StyleSheet } from "react-native";
import ForgotPasswordScreen from "./src/screen/ForgotPassword/ForgotPasswordScreen";
import HomeScreen from "./src/screen/Home/HomeScreen";
import SigninScreen from "./src/screen/Signin/SigninScreen";
import SignupScreen from "./src/screen/Signup/SignupScreen";

const App = () => {
  const screens = {
    Register: { screen: SignupScreen },
    Login: {screen: SigninScreen},
    ForgotPassword: {screen: ForgotPasswordScreen},
  };
  // const Stack = createNativeStackNavigator();
  const Stack = createNativeStackNavigator();

  return (
    // <SafeAreaView style={styles.container}>
    <NavigationContainer>
      <Stack.Navigator initialRouteName="Home">
        <Stack.Screen name="Register" component={SignupScreen} />
        <Stack.Screen name="Login" component={SigninScreen} />
        <Stack.Screen
          name="ForgotPassword"
          component={ForgotPasswordScreen}
          options={{ title: "Overview" }}
        />
        <Stack.Screen name="Home" component={HomeScreen} />
      </Stack.Navigator>
    </NavigationContainer>
    // </SafeAreaView>
  );
};

export default App;

const styles = StyleSheet.create({
  container: {
    flex: 1,
    paddingTop: Platform.OS === "android" ? StatusBar.currentHeight : 0,
    overflow: "scroll",
  },
});
